Banksy\'s 2010 DVD release - Exit Through the Gift Shop

At long last its here! Notorious street artist Banksy, known worldwide....but unknown. A full length Documentary about the life and passions of a street artist, and an in depth look at the minds of the artists, and how they work.

All screen shots are from this torrent, taken from a 24 inch monitor using VLC media player.

Enjoy the flick....I did!

